import React from 'react';

import { Flex } from '../../atoms/layout';

export const Clock: React.FC = () => (
	<Flex
		height="clock"
		width="clock"
		backgroundColor="reds.100"
		borderRadius="100%"
		borderStyle="solid"
		borderWidth={2}
	>

	</Flex>
);
